import React from "react";

const wineBottleStyle = {
  width: 100,
  height: "auto",
};

const soilStyle = {
  width: 150,
  height: 300,
  backgroundColor: "black",
};

function Winebottle() {
  return (
    <div>
      <img
        style={wineBottleStyle}
        src="./wineBottleIcon.svg"
        alt="ワインボトル"
      />
      <div style={soilStyle} />
    </div>
  );
}

export default Winebottle;
